import React from "react";

export default function TextForm(props) {
  return (
    <>
    <h1>{props.heading}</h1>
      <div className="mb-3">
        <label for="text" className="form-label">
          Example textarea
        </label>
        <textarea className="form-control" id="text" rows="3"></textarea>
      </div>
    </>
  );
}
